import React, {Component} from 'react';
import {Col, Row} from 'reactstrap';

const git = [
  {
    cli: "git init",
    usage: "git init [repository name]",
    description: "This command is used to start a new repository.",
    id: '1'
  }, {
    cli: "git clone",
    usage: "git clone [url] ",
    description: "This command is used to obtain a repository from an existing URL.",
    id: '2'
  }, {
    cli: "git add",
    usage: "git add [file]",
    description: "This command adds a file to the staging area.",
    id: '3'
  }, {
    cli: "Naveen",
    usage: "Useless",
    description: "Dead",
    id: '4'
  }
]

function searchingFor(term) {
  return function(x) {
    return x.cli.usage.toLowerCase().includes(term.toLowerCase()) || !term;
  }
}

class Search extends Component {
  constructor(props) {
    super(props);

    this.state = {
      git: git,
      term: ''
    }

    this.searchHandler = this.searchHandler.bind(this);
  }

  searchHandler(event) {
    this.setState({term: event.target.value})
  }

  render() {
    const {term, git} = this.state;
    return (<Row>
      <form className="search">
        <input type="text" name="Search" id="search" placeholder="TYPE GIT COMMANDS HERE" autoCorrect="off" autoCapitalize="off" spellCheck="false" onChange={this.searchHandler} value={term}/>
      </form>
      {
        git.filter(searchingFor(term)).map(github => <Col key={github.id} className="card" sm="12" md="6" lg="4">
          <div className="card-body">
            <p className="Clickbutton">{github.cli}</p>
            <code>{github.usage}</code>
            <p className="card-text">{github.description}</p>
          </div>
        </Col>)
      }
    </Row>);
  }
}

export default Search;
